'use strict';

var form = document.querySelector('form');

function executeQuery(e) {
  e.preventDefault();

  var query = form.search.value;
  var cors = 'https://cors-anywhere.herokuapp.com/';
  var endpoint = cors + 'https://en.wikipedia.org/w/api.php?action=query&format=json&list=search&srsearch=' + query;
  fetch(endpoint).then(function (blob) {
    return blob.json();
  }).then(function (data) {
    data.query.search.forEach(function (result) {
      console.log(result.title);
    });
  });
}

form.addEventListener('submit', executeQuery);
